Photo artist Lauro Giotto is always precise to make his pictures about his models from the best possible angle, in the perfect light. But it is not always easy, especially if his model is someone like Anjela, who is more focused at Lauro's manhood than the success of the shooting itself. And, as it happens, even professional photo artists may have weak moments.
